import React from 'react';
import PostCard from './PostCard';
function Posts({postsToDisplay}){
    console.log(postsToDisplay);
    return(
        <div>
            {
                postsToDisplay.map(post => (
                    <PostCard
                        key = {post.postId}
                        post = {post}
                    />
                ))
            }
        </div>
    )
}

export default Posts;
